import React from 'react';
import styled from 'styled-components';

const TodoTemplate = () => {
  return (
    <TodoTemplates>
      <div className="app-title">일정관리</div>
    </TodoTemplates>
  );
};

export default TodoTemplate;

const TodoTemplates = styled.div``;
